import Bild1 from "../images/Hus1/Bild1.jpg";
import Bild2 from "../images/Hus1/Bild2.jpg";
import Bild3 from "../images/Hus1/Bild3.jpg";
import Bild4 from "../images/Hus1/Bild4.jpg";
import Bild5 from "../images/Hus1/Bild5.jpg";

const images = [
    {id: 0, imagePath:{Bild1}},
    {id: 1, imagePath:{Bild2}},
    {id: 2, imagePath:{Bild3}},
    {id: 3, imagePath:{Bild4}},
    {id: 4, imagePath:{Bild5}}
]; 
export default images;
